import { useNavigate } from "react-router-dom";
import { useSelector } from "react-redux";
const App=()=>{
    const navigate=useNavigate();
    const user=useSelector(state=>(state.userId));
   return
   <div>
    {user&&<button class="button" onClick={()=>navigate('/ShopingList')}>רשימת קניות</button>}
    {user?<button class="button" onClick={()=>navigate('/SignUp')}>התנתק</button>:<button class="button" onClick={()=>navigate('/login')}>להרשמה/התחברות</button>}
   </div>
} 
export default app;
